<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <script src="https://kit.fontawesome.com/62579b347f.js" crossorigin="anonymous"></script>
  <link rel="shortcut icon" href="b&w.png" type="image/x-icon">
  <title>TRAVEL</title>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      
    }

    body {
      width: 100vw;
      max-height: auto;
      background-color: black;
    }

    #top {
      position: sticky;
      top: 0;
      color: #72ff2b;
      width: 100vw;
      height: 5vmax;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      background-color: black;
    }

    #top h1 {
      letter-spacing: 1vmin;
      font-size: 3vmin;
    }

    #line {
      width: 40vmin;
      height: .2vmax;
      background-color: #72ff2b;
      margin-top: .5vmax;
    }

    #gallery {
      box-sizing: border-box;
      width: 100vw;
      /* height: 100vh; */
      height:max-content;
      display: flex;
      flex-wrap: wrap;
      justify-content: space-evenly;
      align-items: center;
    }

    .img {
      width: 20vw;
      height: 30vw;
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: column;
    }

    img {
      width: 80%;
      height: 90%;
      object-fit: cover;
      border-radius: 1vw;
    }

    .img a {
      width: 60%;
      height: auto;
      padding-top: .5vw;
    }

    .img button {
      height: 100%;
      width: 100%;
      background-color: #72ff2b;
      border-radius: 2vw;
      font-weight: 400;
      font-size: 1vw;
    }
  </style>
</head>
